INSERT INTO `post` (`judul`, `teks`, `gambar`, `post_id`, `username`) VALUES
('What to Bring ', 'The items you need to bring are just everyday items that you''d bring when taking your baby outside your home. Common items include:\r\n\r\n1. Baby diaper - to be changed into after the bath.\r\n2. New change of clothes - again, to change into after the bath.\r\n3. Milk, water or snacks - babies will be very hungry and thirsty after so much\r\nexercise.\r\n4. Optional extra towel - to provide more familiarity to older babies.\r\n5. Optional favorite bathing toy - also to provide more familiarity to older babies.', , 1, 'oktavia');
INSERT INTO `post` (`judul`, `teks`, `gambar`, `post_id`, `username`) VALUES
('The neck flotation device used on baby', 'It might look a bit odd at first glance, but this hydrotherapy pool is just one of the treatments on offer at an up-market baby spa in London.\r\n\r\nThe neck flotation device used on baby , also known as a Bubby, was designed by spa founder Laura Sevenus and her husband, and helps babies to explore their surroundings without being held or laying flat on the floor.\r\n\r\nCharlotte Davis, who works at the spa, explains: "When a baby is first born they feel that they''re just a ''blob'', they don''t know they''ve got a left, right, back or front.\r\n\r\n"We''re constantly holding them or they''re lying on their back - there''s constantly something touching them.\r\n\r\nChelsea WhiteChilling: Harlen enjoys a float in the hydrotherapy pool\r\n"The flotation device creates a feeling of euphoria - it''s the first time they''re upright without being held. They don''t feel the Bubby, particularly.\r\n\r\n"Baby is upright, wiggling around and having to balance when they''ve never had to do that before."\r\n\r\nChelsea White, a mum-of-two who took her baby boy to the spa , said: "Harlen was really still and super calm for the first minute or so when he was in the water.\r\n\r\n"He was concentrating and adjusting to the environment, the staff said all the babies do this.\r\n\r\n"Then he started moving, kicking his legs and splashing with his arms and looked like he was really enjoying himself.\r\n\r\n"The neck ring caused no discomfort to him at all, it looks a little bit strange from the videos and pictures as you can’t quite tell how it''s put on to the baby, and some comments have suggested that it looks like it chokes the baby.\r\n\r\n"The ring is not touching his neck at all, only at the back, and his cheeks and chin rest on the ring. It took seconds to put on and he was in no discomfort whatsoever during any of the experience, I can’t wait for him to go back as I know he will love it again."\r\n\r\nLaura Sevenus, has been passionate about swimming and babies since she was a child, dedicating her life to sharing the benefits and pleasures of learning to swim with young and old.\r\n\r\nShe has over 40 years experience in providing safe and beneficial water-based environments for babies.', , 2, 'felita');
INSERT INTO `post` (`judul`, `teks`, `gambar`, `post_id`, `username`) VALUES
('How to massage your baby', '1 / 12\r\nSetting up\r\nThese techniques are good for all pre-crawling babies. For the best chance of success, don''t try a massage just before or after a meal.\r\n\r\nWhen you think your baby''s ready, set up on the floor with a towel and a small bowl of vegetable-based oil.\r\n\r\n\r\n2 / 12\r\nThe legs\r\nYour baby''s legs are a good place to begin, as they''re less sensitive than some parts of the body. Using a little oil, wrap your hands around one of her thighs and pull down, one hand after the other, squeezing gently, as if you''re "milking" her leg. Switch legs and repeat.\r\n\r\n\r\n3 / 12\r\nThe feet\r\nTake one foot and gently rotate it a few times in each direction. Then stroke the top of your baby''s foot from the ankle down to the toes. Switch feet and repeat.\r\n\r\n\r\n4 / 12\r\nThe soles\r\nUse your thumbs to trace circles all over the bottom of each foot.\r\n\r\n\r\n5 / 12\r\nThe toes\r\nTo finish off the feet, grab each toe between your thumb and forefinger and gently pull until your fingers slip off the end. Do this for all 10 toes.\r\n\r\n\r\n6 / 12\r\nThe arms\r\nTake one of your baby''s arms in your hands and repeat the milking motion from his armpit all the way to his wrist. Then, take his hand and gently rotate the wrist a few times in each direction. Switch arms and repeat.\r\n\r\n\r\n7 / 12\r\nThe hands\r\nTrace tiny circles all over the palm of each hand with your thumbs.\r\n\r\n\r\n8 / 12\r\nThe fingers\r\nGently take a finger between your thumb and forefinger and pull, letting her finger slip through your grasp. Do this for all fingers and her two thumbs.\r\n\r\n\r\n9 / 12\r\nThe chest\r\nPut your hands together in prayer position over your baby''s heart. Then stroke your hands outward and lightly flatten your palms down over his chest. Repeat several times.\r\n\r\n\r\n10 / 12\r\nThe chest (continued)\r\nPlace one hand flat across the top of your baby''s chest. Stroke it gently down to his thighs. Repeat the motion, alternating hands, several times.\r\n\r\n\r\n11 / 12\r\nThe back\r\nRoll your baby onto her tummy. Using your fingertips, trace tiny circles on either side of her spine from the neck down to the buttocks.\r\n\r\n\r\n12 / 12\r\nThe back (continued)\r\nFinish with some long, firm strokes from your baby''s shoulders all the way to her feet. When you''re done, put on her diaper and cuddle or feed her. She''ll likely doze right off.', , 3, 'deby');
INSERT INTO `post` (`judul`, `teks`, `gambar`, `post_id`, `username`) VALUES
('A retreat for a Royal baby!', '''Baby Spa creates a calm, soothing and fun experience for both the parent and baby,'' Laura, a former South African competitive swimmer, explained.\r\n''It''s amazing to watch the intense pleasure, contentment, and curiosity the babies of just a few days or weeks old show as soon as they float in the warm water.''\r\n\r\nAccording to Laura, the most popular treatment is the use of Bubby floats that allow the tots to rest comfortably on the water''s surface.\r\n''The Bubby is a patented flotation device that fits loosely around a baby''s neck, supporting an infant of any weight safely and comfortably in the water,'' she said.\r\n\r\nBabies as young as two days benefit from the hydrotherapy and its emphasis on developing range of motion\r\n\r\nThe flotation ring - called a Bubby - is fitted specifically to each baby to support their weight in the water\r\n''Once the Bubby is fitted at the beginning of Baby Spa visits, the baby is placed in an individual neonatal pod or larger spa pool for up to 30 minutes of therapeutic immersion.''\r\nThe babies can then move around freely and have fun in the water, while also developing a larger range of movements.\r\nShe added: ''The comforting experience strengthens muscles and bone structure, whilst providing an environment where they can build confidence in the water.''\r\n\r\nThis hydrotherapy improves the infant''s sleep quality and reduces discomfort from colic, wind, and constipation.\r\nWith regular visits, cardiovascular and respiratory systems also benefit.\r\nMassages, where neonatal and pediatric nurses give comforting body rubs to the sound of soothing music, are also available. \r\nAn avid swimmer, Laura also launched the Severus Swimming School in 2000 and hopes that early exposure to hydrotherapy will encourage an all-new generation of water lovers.\r\n\r\n', , 4, 'aulya');
INSERT INTO `post` (`judul`, `teks`, `gambar`, `post_id`, `username`) VALUES
('First Time Baby SPA at home', 'We''ve heard about the baby spa, which let baby swim in a special pool (warm and clean water) and massage the baby after that, with the tender touch of course. Some articles that I found about this baby swim tells that baby who practices swim since early born will improve his IQ, and it makes me feel more enthusiasm about it. But, there''s still some kind of rule to do this activity, we must give extra attention in baby''s safety. So, I and my husband start to buy all equipment that necessary. Since we intend to do this baby spa at home, not in the baby saloon, we must prepare all the things to include the technique to massage the baby. You can find this technique only by googling it. \r\n\r\nBut here is everything that you''ll need in massaging baby:\r\nMassage oil/Baby oil\r\nTowels or muslin squares to mop up any accidents\r\nyour usual nappy changing kit \r\nAnd here I share the tools/equipment to do this baby spa at home, I''ll provide the price instead.\r\nNeck ring - IDR. 35.000,- (It keeps baby''s head on top of water)\r\nBaby''s pool brand Intime - IDR 180.000 (I buy the medium size, so we can swim  together with our baby)\r\nRubber duck - IDR 15.000/package (just a toy for my qeenan, he like to squeeze it, Put it in the baby pool so your baby will try to reach it and will improve your baby motorically.\r\nHand Pump - IDR. 35.000 - Helps for pumping the pool or neck ring (You can buy electric pump for IDR 150.000 and its really saving your time)\r\nSwim Diapers Huggies - IDR 20rb/pcs (but you can also use baby panties, just to prevent his pee contaminates the water)\r\n Tools completed! Now, we can start the baby spa. And here are the steps to do the baby spa;\r\nFirst, Massage baby with baby oil, start from bottom, leg, arm, till his body upside. \r\nSecond, Prepare the water in the pool, make sure the temperature is warm enough, not too hot and not too cold. I adding one or two drops of baby oil to the water, it helps to make baby''s skin more tender.\r\nThird, carry your baby safely and slowly placed him into the water start from his leg, not too rush cause it can shock your baby. When he already feels comfortable with the water, then put the neck ring on him, and slowly placed his full body to the water. and what I amaze is that Qeenan looks so happy in the water. He seems familiar with this activity, you know that when the baby in his mother''s womb he/she do swim all the time in mom''s amnion. \r\nLast, Enjoy watching your baby swims. You can also swim together with a bigger pool.\r\nYou can add some rubber toys (I put some rubber ducks) into the pools so your baby will try to reach the toys in it will helps to improve his motoric skills.\r\n\r\nAnd one thing you have to remember that your baby is not you! So don''t let your baby swim more than 15 minutes, especially for his first-time swim. As older he is, you can let your baby swim much longer.\r\n\r\nNow, please practice it at your home.. :)', , 5, '');
INSERT INTO `post` (`judul`, `teks`, `gambar`, `post_id`, `username`) VALUES
('Psycho-Social Benefits of Baby Massage', 'Touch is the primary communication received by a newborn. Infant massage has been a longstanding tradition. Being caressed and touched through massage also acts as psychological food for your infant. It is the best form of touch therapy for infants. It is a communicative approach and helps parents relax the baby as well as connect in a positive way.\r\n\r\nPhysical Benefits of Baby Massage\r\n\r\nMassage is one of the best ways to improve the health of your infant. Just as adults benefit from a massage, there are numerous benefits associated with infant massage for better physical development. Some important ones have been listed below:\r\n\r\nBetter sleep: Infant massage helps in increasing serotonin levels in the body. This neurotransmitter is known to regulate mood. High levels of serotonin provide a feeling of well-being. As a result, it ensures better sleep that is deeper and more restful.\r\nReduces stress and cranky behavior: It is common for babies to cry for various reasons. General reasons causing your baby to cry or act cranky include discomfort, pain in legs or abdomen, tiredness or improper sleep. Regular massage can relieve your infant from pains and discomforts, thus providing better sleep. This further reduces the crying and cranky behavior of the infant.\r\nRelief from flatulence: Many infants experience chronic abdominal pain due to intestinal gas. Belly massage increases the pace of waste removal from body. This way, trapped wind is also easily released by the body.\r\nRelieves digestion problems: Massage speeds up the natural progression of food along the digestive tract. This way, the massage has proven to be helpful is eliminating problems like constipation and acid reflux.\r\nStrengthens the immune system: Just like massage benefits various physiological processes in the body, it also benefits the immune system. Regular massage gives a newborn baby’s immune system a boost, thereby keeping common ailments at bay.\r\nImproves weight: Some babies are underweight at the time of birth. Massage provides significant improvement in the weight gain process, thus providing healthy weight to underweight infants.\r\nImproves motor development: Baby massage stimulates the nervous system. This makes the infants more aware about their body’s functions during the massage process. This way, infant massage improves flexibility, co-ordination and muscle control.\r\nRelieves congestion: In addition to benefits like speeding up of nervous system and providing relief from digestion problems, baby massage also provides relief from congestion. Massage aids improved drainage of sinuses, thus preventing fluid accumulation in the sinuses and airways.', , 6, '');
INSERT INTO `post` (`judul`, `teks`, `gambar`, `post_id`, `username`) VALUES
('Baby Massage Tips', 'Generally, people appoint masseur or professional caretakers for infant massage. It is, however, recommended your massage your baby yourself. This would provide better bonding and an affectionate relationship between you. You can take guidance from elders in the family or your doctor for proper massage techniques.\r\n\r\nImportant Massage Moves:\r\n\r\nCheck out the following massage moves to get started with the process.\r\n\r\nHead Massage\r\nApply some oil on your baby’s body. Then massage with fingertips in extremely gentle, circular motions all around the head.\r\n\r\nNeck Massage\r\nSupport the head and upper body of your child on one hand. Use the other hand to massage the neck with thumb and first two fingers in gentle, circular motions.\r\n\r\n\r\nBelly Massage\r\nPut your hands at the navel. With your fingertips, massage in gentle yet firm circular motions over the tummy. Repeat these motions a few times.\r\n\r\nColic-relief Massage\r\nAfter the belly-massage, bend the baby’s knees up to the tummy. Hold the position for about 30 seconds and release. Repeat 2 to 3 times. After that, put one hand’s edge on his/her belly. Start gliding downwards from the belly button in a rhythmic pattern. This will help in releasing built-up gas in the stomach.\r\n\r\nArm Massage\r\nRoll the baby’s arms gently between the hands. Start from shoulders and move down towards the wrist. Repeat it twice or three times, and then focus on other arm.\r\n\r\nLeg Massage\r\nThe movements for leg massage are similar to those used for massaging the arms. Start from the thighs and move down to the ankles. Repeat 2 to 3 times for each leg.\r\n\r\nSome important things to take care of during infant massage have been listed below.\r\n\r\nRegular massage schedule\r\nMake it a routine to massage your baby at same time every day. This would make him/her expect and then enjoy the massage. Select a time when you are not in a rush to complete other household tasks. Also, make sure your child is neither too hungry nor too full before massage.\r\n\r\nSelect a good massage oil\r\nGo for edible massage oil that is unscented. Cold-pressed vegetable or fruit oil is also a good choice. These oils aid easy gliding of hands over the baby’s body. Some of the best options include canola, coconut, corn, grape seed, olive, avocado, apricot and safflower oils. These oils get easily absorbed by the skin. Just a dab of oil is sufficient for massage. It is best to avoid mineral oils as these might lead to clogging of pores.\r\n\r\nBe gentle\r\nMake your movements as gentle as possible. One smart tip is to apply strokes in directions that move away from the heart. For example, from shoulder to wrist and from thigh to ankle. These movements are more relaxing and suitable for better sleep. Applying strokes towards heart are more stimulating and keep the baby active when awake.\r\n\r\nSelect a comfortable place\r\nFind a place for massage that is comfortable for you as well as the baby. The place should also be warm enough to prevent the baby from catching a chill. Playing relaxing music in the background can enhance the effects of massage. Other ways to boost massage results include singing or talking to your baby during the process.\r\n\r\nNotice cues offered by your infant\r\nJust like adults, babies also don’t like to be massaged if they aren’t in a good mood. If your baby frowns, turns away or cries on being touched, postpone the massage session. Moreover, it is not necessary to massage the whole body every time. Follow the indications given by your baby. Sometimes rubbing the hand and feet is sufficient to relax and benefit your baby.\r\n\r\nBesides the above mentioned benefits of infant massage, it has also been noted baby massage relieves postnatal depression among many women. This is because of the quality time spent together by the baby and mother. Infant massage has been known to be the most vital and dynamic interaction to lay the foundation of a unique mother-child bond.', , 7, '');
INSERT INTO `post` (`judul`, `teks`, `gambar`, `post_id`, `username`) VALUES
('Shark Tank is dangerous?', 'There are few things more relaxing than a day at the spa, but this is an opportunity typically only extended to adults. Kristi Ison aims to change all this with Float Baby, a spa designed especially for stressed little tykes under the age of 12 months. Shark Tank viewers are worried that this concept could be both impractical and dangerous. \r\n\r\nNearly every week, there is at least one completely ridiculous product or service featured on Shark Tank. This time, the silly idea was Float Baby, which basically is a glorified bathtub in which babies sit in inflatable tubes. These tubes are actually placed around their necks; the goal of this is to give babies greater range of motion. Entrepreneur Kristi Ison believes that, just as adults are able to ease their stress when hanging out at the spa, the tiny visitors at Float Baby can also relax and enjoy all kinds of physical and mental benefits.\r\n\r\nAs expected, the Sharks were doubtful about the idea of a spa designed for babies. They didn''t think its potential for profitability was very good, especially as it costs parents well over $50 to hang out at the spa with their babies. The Sharks also worried about Ison''s alleged lack of hustle.\r\n\r\nThe Sharks were not alone in their fears; viewers also expressed quite a bit of negativity upon learning of Ison''s spa. Many were less concerned about the poor profit margin and more fearful of the potential dangers associated with Float Baby. Several viewers took to Twitter to voice their concerns; these fears included everything from neglect to strangulation. A few of the most negative tweets of the evening are highlighted below:\r\n\r\nFloat Baby may not be very practical, but it''s also likely not as dangerous as viewers think. Yes, the image of babies with rings around their neck is concerning, but some of the fears viewers have expressed are unfounded. A pediatrician told Today that a baby spa involving inflatable rings can actually be quite safe, as long as babies wear swim diapers. However, this pediatrician also feels that parents and their babies can enjoy many of the benefits associated with Float Baby for free each evening during bathtime. For the average family, Float Baby just isn''t necessary.\r\n\r\nThose who remain convinced of Float Baby''s dangerous nature will be relieved to learn that the Sharks decided not to back the business. Kristi Ison is not likely to be deterred however; just as other rejected entrepreneurs have muddled on without the Sharks'' help, Ison will surely continue on in her quest to rid the world''s babies of all stress.', , 8, '');
INSERT INTO `post` (`judul`, `teks`, `gambar`, `post_id`, `username`) VALUES
('Are Infant Neck Floats Safe?', 'There is no denying that people love to share adorable baby photos. Occasionally, you might find someone posting cute pictures of their babies at a swimming pool or hot tub with infant neck float on. This practice is said to “have the ability to increase the baby’s athleticism and coordination.” While that sounds great, the reality of it is that these infant neck floats are not safe for babies to use.\r\n\r\nSo why are Infant Neck Floats unsafe?\r\nFirst of all, the way these infant neck floats are designed to function is extremely unnatural. Just imagine yourself, being strapped with a neck float in the water. Your head and neck are being restricted, and your body can only stay vertical in the water. I’m sure most people will agree that this wouldn’t feel very comfortable. If something seems uncomfortable for even the adults to use, then it shouldn’t even be mentioned as use for babies!\r\n\r\nAsides from looking uncomfortable, these floats function by using water buoyancy to keep only the head afloat which can cause tremendous stress to the neck. For babies, whose bone and muscle aren’t fully developed yet; it becomes an even bigger issue! Their body weight ends up unnaturally supported by an upward pulling force around the head. Even with the natural buoyancy of water helping to lessen the body weight, there is still a very high chance of injury.\r\n\r\nKnowing how dangerous it is, would you still use it?\r\nThe muscles that are most essential to a newborn’s development are usually the neck and the back. Most of the actions in the next development stage (such as sitting up and crawling) will rely majorily on those. There are certain swimming and parenting classes that might encourage the use of these neck floats, claiming that it will help develop coordination and muscle strength. However, with the neck floats in place, the head and neck are restrained. Floating vertically in the water like that does not efficiently develop the neck, shoulder and back muscles.\r\n\r\nPediatricians have strongly recommended against the use of neck floats. There are a lot of different exercises suitable for young babies. Rather than having young babies involved in unsafe exercises, let them have more “Tummy Times” instead. Not only is it a lot safer, it’s also the perfect way to develop the muscles needed!\r\n\r\nIn a safe and controlled environment, taking your baby to play with water or swim does benefit their sensory development. But before signing up your baby for a swimming class, you need to note the followings:\r\n\r\nThe American Academy of Pediatrics does not suggest babies under 12 months old to learn to swim. What they mean by this is: Although many advertisements show that swimming offers babies a lot of benefits. There is no scientific study to show that these lessons are actually teaching them anything. Therefore, when signing up you baby to a “swimming” lesson, you should focus more on the entertainment and safety, and not the actual “swimming” as they are still too young to actually learn.\r\nSwimming classes should always be accompanied by parents as well.\r\nParents can choose to instead enroll in programs run by reputable organizations like Red Cross. They will usually have strict pool and hygienic standards. They even regulate the water temperature to constantly be at around 32°C!\r\nThe swimming instructors must have the proper qualification and experience! Ideally, there shouldn’t be too many people in a class as well. That way the instructor can pay more attention to make sure everyone is safe.\r\nIf you’re not interested in enrolling into a class, and instead want to just take your baby to the public pool by yourself. Here are some things you need to be aware of:\r\n\r\nWhen you’re inside the pool, please make sure that your child is always within an arm’s reach, and always within your line of sight. Never leave your baby alone in the pool, not even for one second!\r\nBabies under 12 months old should not stay in the water for more than 30 minutes. They lose heat a lot faster than an adult.\r\nWater temperatures at the pool should ideally be around 32°C, any hotter or colder is not recommended for babies. If your child is starting to shiver inside the water, quickly take them out of a pool and warm up with a dry towel.\r\nDo not submerge your child in water. Humans are not fish. Swimming is a skill that needs to be learned as we grow up, it is not inherently a trait.\r\nDo not use safety gear randomly. For babies, the best protection is still the parent’s watchful eyes. If you want to take extra precautions, use a baby-sized life jacket instead. Once again, make sure to always keep your baby within an arm’s reach at the pool!\r\nSo how old should a child be before actually learning how to swim?\r\n\r\nThe American Academy of Pediatrics (AAP) suggests that:\r\n\r\nFor the most part, children should be at least 4 years old before learning how to swim. By this age, their body will have developed enough to swim.\r\n\r\nAs of now there is not enough research to show what kind of teaching method is best for children aged 1 to 4. Parents who wish to enroll their child to swimming classes need to be extra attentive. Remember that every child is different. Some will learn how to swim when they are extremely young, and some will end up never knowing how to swim but you should never compare your child to someone else’s!\r\n', , 9, '');
INSERT INTO `post` (`judul`, `teks`, `gambar`, `post_id`, `username`) VALUES
('Do babies need a spa?', 'After a long, hard day of being a baby, there''s nothing better than kicking off your booties and heading to the spa.\r\n\r\nAt least that''s what Houston tots can do now that Float Baby, a business offering water and massage therapy to infants, recently set up shop.\r\n\r\n"What I see during class are peaceful, happy babies enjoying the bonding process and the sensory stimulation," owner Kristi Ison told USA TODAY Network in an e-mail (she declined a request for an interview).\r\n\r\nAt float sessions, infants wear inflatable tubes around their necks and float in a small pool of water with up to three other babies. The flotation device, which is patent-pending, allows each baby to move their arms and legs freely while floating independently.\r\n\r\n"What we find is that the babies find the water very soothing and relaxing," Ison told TODAY Moms in May. Babies take to the water quickly because of their recent time in the womb, Ison said in the interview.\r\n\r\nAfter their time in the water, babies are dried off and instructors guide caregivers through infant massage.\r\n\r\nAlthough the term "spa" is used by the company on their Facebook page, Ison said in her e-mail that the business is "not a Baby Spa," but rather an environment focused on a baby''s development\r\n\r\nIson cited research suggesting water therapy improves babies'' physical strength and discipline. However, a pediatrics expert says the jury may still be out on whether this form of therapy is truly beneficial.\r\n\r\n"We don''t have a huge amount of information and data from an academic standpoint, either positively or negatively," Hilary McClafferty, a fellow with the American Academy of Pediatrics who focuses on integrative medicine, told USA TODAY Network when asked about the benefits of water therapy for infants.\r\n\r\n"I don''t think there''s anything necessarily extraordinary about putting them in water," McClafferty said, noting that she didn''t want parents to think their babies would be missing out if they couldn''t afford the $65 a session fee.\r\n\r\n"While it has potential to be a relaxing and enjoyable experience if properly supervised, a baby could get a similar effect in a tub in another setting with a caretaker or a parent," she added.\r\n\r\nAnd while she can''t speak to this particular facility, McClafferty did say that parents who take their babies to water spas should thoroughly check out how the facility is maintained.\r\n\r\n"You would want to ask what method is used to purify the water," she said. "Very, very young babies, their immune system isn''t mature yet, and if there is another baby that has a skin condition or leakage of the swim diaper, anything could be transmitted."\r\n\r\nShe also advised that parents ask what is in the material used for the pool area in case there is a chemical like BPA in the plastic. "That poses a risk to babies similar to the chemicals leached from baby bottles," she said.\r\n\r\nAccording to the interview with TODAY, the Float Baby water is purified and the pools are cleaned daily.\r\n\r\nAs for massage, there is research to prove that massage calms babies, promotes growth and encourages normal food movement, McClafferty said.', , 10, '');

